  <style type="text/css">
   body {
            white-space: nowrap;
            }

            overflow: scroll;
            width: 683px;
        }
        .page_top_container {
            overflow: scroll;
            height: 500px;
        }
        .page_frame {
            width: 1366px;
            height: 500px;
        }
  </style>

 <body>
  <script src="https://ajax.googleapis.com/ajax/libs/jquery/1.11.3/jquery.min.js">
  </script>
  <script src="http://rawgit.com/morr/jquery.appear/master/jquery.appear.js" type="text/javascript">
  </script>
  <script src="//cdn.jsdelivr.net/jquery.scrollto/2.1.0/jquery.scrollTo.min.js">
  </script>
  <script type="text/javascript">
   $(function() {
            $(".page_img_container").appear();
            $(".page_img_container").on('appear', function(e, $appeared) {
                $(this).toggleClass("page_img_container_active", true);
                page_img_instances = $(this).children(".page_img_instance");
                page_img_instances.each(function() {
                    if ($(this).attr("src") == undefined) {
                        $(this).attr("src", $(this).attr("data_observatory_src"))
                    };
                });
            });
            $(".page_img_container").on('disappear', function(e, $disappeared) {
                $(this).toggleClass("page_img_container_active", false);
            });

            $(".page_frame_container").appear();
            $(".page_frame_container").on('appear', function(e, $appeared) {
                var container = $(this)
                page_frames = $(this).children(".page_frame");
                page_frames.each(function() {
                    if ($(this).attr("src") == undefined) {
                        $(this).attr("src", $(this).attr("data_observatory_src"))
                        $(this).load(function () {
                            $(this).height($(this.contentWindow.document).height())
                            container.toggleClass("page_frame_container_active", true);
                        })
                    } else {
                        container.toggleClass("page_frame_container_active", true);
                    }
                });
            });
            $(".page_frame_container").on('disappear', function(e, $disappeared) {
                $(this).toggleClass("page_frame_container_active", false);
            });
            $.force_appear();
        });
  </script>
  <script type="text/javascript">
   var page_img_containers_top = 0;
        var page_img_containers_left = 0;

        var page_frame_containers_position = [];

        function update_scroll_all_imgs() {
            active_page_img_containers = $(".page_img_container_active");
            active_page_img_containers.scrollTop(page_img_containers_top);
            active_page_img_containers.scrollLeft(page_img_containers_left);
        }

        function update_scroll_page_frame(el) {
            var el_row = $(el).attr("data-row")
            if (el_row in page_frame_containers_position) {
                el_row_position = page_frame_containers_position[el_row]
                //console.log("Trying to change position to left: " + el_row_position._left +  ", top: " + el_row_position._top)
                $(el).scrollLeft(el_row_position._left)
                $(el).scrollTop(el_row_position._top)
                //console.log("Stored position: left: " + el_row_position._left +  ", top: " + el_row_position._top)
            }
        }

        function update_scroll_all_page_frames() {
            active_page_frame_containers = $(".page_frame_container_active");
            active_page_frame_containers.each(function () {
                update_scroll_page_frame(this)
            });
        }

        window.onload = function() {
            var page_img_containers = $(".page_img_container");
            setInterval(update_scroll_all_imgs, 1);
            var update_scroll_interval = setInterval(update_scroll_all_page_frames, 16);
            page_img_containers.each(function () {
                $(this).scroll(function () {
                    page_img_containers_top = $(this).scrollTop();
                    page_img_containers_left = $(this).scrollLeft();
                });
            });

            var page_frame_containers = $(".page_frame_container");
            var page_frames = $(".page_frame");
            page_frame_containers.each(function () {
                $(this).scroll(function () {
                    var this_row = $(this).attr("data-row")
                    //if (this_row in page_frame_containers_position) {
                    //  console.log("Previous position: left: " + page_frame_containers_position[this_row]._left +  ", top: " + page_frame_containers_position[this_row]._top)
                    //}
                    page_frame_containers_position[this_row] = {_left: $(this).scrollLeft(), _top: $(this).scrollTop()};
                    //console.log("Updated position: left: " + page_frame_containers_position[this_row]._left +  ", top: " + page_frame_containers_position[this_row]._top)
                });
            });
        };
  </script>
